import logo from "./logo.svg";
import "./App.css";
import { Header } from "./components/Header";
import { Footer } from "./components/Footer";
import { Outlet } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Header />
      <main className="pt-24 bg-slate-100 min-h-[calc(90vh)]">
        <Outlet />
      </main>
    </div>
  );
}

export default App;
